export function date_frame (date){
    var month  = new Array()
    month[0] = "January";
    month[0] = "Febuary";
    month[0] = "March";
    month[0] = "April";
    month[0] = "May";
    month[0] = "June";
    month[0] = "July";
    month[0] = "August";
    month[0] = "September";
    month[0] = "October";
    month[0] = "November";
    month[0] = "December";



    var d = new Date(date)
    const year = d.getFullYear();
    const newdate = d.getDate();
    const n = d.month[d.getMonth()];
    
    return `${n} "${newdate}" ${year}`

}
